import React from "react";

const login = () => {
  return (
    <div className="flex h-max p-10 text-center bg-blur my-auto">
        <form>
            <input className="w-full py-2 px-3 rounded-md" placeholder="Username"/>
            <input className="w-full py-2 px-3 rounded-md" placeholder="password"/>
            <button className="bg-sky-700 w-full py-2 px-3 rounded-md" type="submit" >Login</button>
        </form>
    </div>
  );
};

export default login;
